import React from 'react';
import styled from 'styled-components';
import TodoItem from './todoItem';


const TodoListBlock = styled.div`
    flex: 1;
    padding: 20px 32px;
    padding-bottom: 48px;
    overflow-y: auto;
    background: deepskyblue;
`;

function TodoList(){
    return (
    <TodoListBlock>
        <TodoItem text="프론트앤드 프로젝트 만들기"/>
    </TodoListBlock>)
}

export default TodoList;
